import logo from "../../img/repologo.png";
import "./Style.css";

function Footer() {
  return (
    <footer className="footer">
      <img className="footer-logo" src={logo} alt="" />
      <span className="footer-logo-texto">Copyright 2022 © Repo Inc.</span>
    </footer>
  );
}

export default Footer;
